from typing import List,Deque

class Solution:

    # BFS
    def countSubIslands(self, grid1: List[List[int]], grid2: List[List[int]]) -> int:
        
        def bfs(startX, startY):
            isSub = grid1[startX][startY] == 1
            queue = Deque()
            queue.append((startX, startY))
            grid2[startX][startY] = 2
            while queue:
                x, y = queue.popleft()
                for dx, dy in ((-1,0),(1,0),(0,-1),(0,1)):
                    nx, ny = x + dx, y + dy
                    if 0 <= nx < len(grid2) and 0 <= ny < len(grid2[0]) and grid2[nx][ny] == 1:
                        if nx >= len(grid1) or ny >= len(grid1[0]) or grid1[nx][ny] != 1:
                            isSub = False
                        queue.append((nx, ny))
                        grid2[nx][ny] = 2
            return isSub

        if not grid1 or not grid2:
            return 0
        result = 0
        for i in range(len(grid2)):
            for j in range(len(grid2[0])):
                if grid2[i][j] == 1:
                    if bfs(i, j):
                        result += 1
        return result

    # DFS optimized
    def countSubIslandsDFS(self, grid1: List[List[int]], grid2: List[List[int]]) -> int:

        def dfs(x, y):
            if x < 0 or x >= m or y < 0 or y >= n:
                return 1
            if grid2[x][y] != 1:
                return 1
            grid2[x][y] = 2
            return grid1[x][y] & dfs(x - 1, y) & dfs(x + 1, y) & dfs(x, y - 1) & dfs(x, y + 1)

        m, n = len(grid1), len(grid1[0])
        res = 0
        for i in range(m):
            for j in range(n):
                if grid2[i][j] == 1:
                    res += dfs(i, j)
        return res
    
    # DFS Brute, TLE
    def countSubIslandsDFSBrute(self, grid1: List[List[int]], grid2: List[List[int]]) -> int:

        def isSubIsland(island2, island1):
            for x2, y2 in island2:
                if (x2, y2) not in island1:
                    return False
            return True

        def dfs(grid, x, y, m, n, island):
            if 0 <= x < m and 0 <= y < n and grid[x][y] == 1:
                island.append((x, y))
                grid[x][y] = 2
                dfs(grid, x - 1, y, m, n, island)
                dfs(grid, x + 1, y, m, n, island)
                dfs(grid, x, y - 1, m, n, island)
                dfs(grid, x, y + 1, m, n, island)

        def getIslands(grid):
            islands = []
            m, n = len(grid), len(grid[0])
            for i in range(m):
                for j in range(n):
                    if grid[i][j] == 1:
                        island = []
                        dfs(grid, i, j, m, n, island)
                        islands.append(island)
            return islands

        islands1 = getIslands(grid1)
        islands2 = getIslands(grid2)
        res = 0
        for island2 in islands2:
            for island1 in islands1:
                if isSubIsland(island2, island1):
                    res += 1
                    break
        return res

import unittest

